import { useState } from "react";
import { createOnlineOrder } from "../../api/orderApi";

function OnlineOrderCreate() {
  const [orderId, setOrderId] = useState("");
  const [address, setAddress] = useState("");
  const [phone, setPhone] = useState("");

  const submit = async () => {
    await createOnlineOrder(Number(orderId), address, phone);
    alert("Online order created");
  };

  return (
    <div>
      <h2>Create Online Order</h2>

      <input
        placeholder="Order ID"
        value={orderId}
        onChange={e => setOrderId(e.target.value)}
      />
      <br /><br />

      <input
        placeholder="Address"
        value={address}
        onChange={e => setAddress(e.target.value)}
      />
      <br /><br />

      <input
        placeholder="Phone"
        value={phone}
        onChange={e => setPhone(e.target.value)}
      />
      <br /><br />

      <button onClick={submit}>Save</button>
    </div>
  );
}

export default OnlineOrderCreate;
